import React, { useState } from "react";
import List from "./List";
import Form from "./Form";

function Contacts(){
    const [contacts, setContacts] = useState([]);

    return(
        <div>
            <List/>
            <Form addContact={setContacts} />
        </div>
    )
}
export default Contacts;
